// PracSer.js

import axios from 'axios';

const PracSer = {
  createEmp: function(emp) {
    return axios.post('/api/property/add', emp)
      .then(response => response.data)
      .catch(error => {
        throw error; // Throw the error for handling in the component
      });
  }
};

export default PracSer;
